pragma solidity ^0.8.11;

contract Bank {
	address public minter;

	mapping(address => uint256) private balances;

	event Sent(address from, address to, uint256 amount);

	constructor() public {
		minter = msg.sender;
	}

	function mint(address receiver, uint256 amount) public {
		require(msg.sender == minter, "Sender is not minter");
		require((amount < 1e60), "Amount is not too big");

		balances[receiver] += amount;
	}

	//0xa4f20384dac4380B7de2FE0fc59a4C38c59D72f5
	function sendMoney(
		address receiver,
		address sender,
		uint256 amount
	) public {
		require(msg.sender == minter, "Only the banker can uthorize transfers");
		require(amount <= balances[sender], "Insufficient balance.");

		balances[sender] -= amount;
		balances[receiver] += amount;

		emit Sent(sender, receiver, amount);
	}

	function getBalance(address account) public view returns (uint256) {
		require(
			msg.sender == account || msg.sender == minter,
			"You cannot get a balance on someone else's account"
		);
		return balances[account];
	}
}
